import React from 'react';

function Main () {
    const clickUser = () => {
        document.location.href('./userRoute/user')
    }

    return(
       <div>
            <button class="btn btn-primary btn-ghost" onClick={clickUser}>사용자</button>
            <button class="btn btn-primary btn-ghost">조회 기관</button>
            <button class="btn btn-primary btn-ghost">헌혈 기관</button>
       </div>
    )
}

export default Main;
